import Vue from 'vue'
import VueRouter from 'vue-router'
import HomeView from '../views/HomeView.vue'
import BulletinView from '../views/BulletinView.vue'

Vue.use(VueRouter)

const routes = [
  {
    path: '/',
    name: 'home',
    component: HomeView
  },
  {
    path: '/bulletin',
    name: 'BulletinView',
    component: BulletinView
  }
]

const router = new VueRouter({
  mode: 'history',
  routes
})

export default router
